import React from "react";
import "./LoaderLogo.css";

class LogoLoader extends React.Component {
  render() {
    const theme = this.props.theme;
    return (
      <svg
        className="raw_logo"
        width="50%"
        height="40%"
        viewBox="0 0 440 305"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
      >
        <path
          d="M50,150 C50,50 150,50 150,150 C150,250 50,250 50,150 Z"
          fill="black"
          transform="translate(100, 0)"
        />
        <path
          d="M200,150 C200,50 300,50 300,150 C300,250 200,250 200,150 Z"
          fill="black"
          transform="translate(0, 50)"
        />
      </svg>
    );
  }
}

export default LogoLoader;
